class Test_EditGuidesShape( MayaTest.OxTestCase ):

	def ExecuteEditGuidesOffsetCommand( self, editGuidesShape ):
		editGuidesCommandArguments = '-eg ';
		editGuidesCommandArguments += str( pm.mel.OxGetStrandCount( editGuidesShape ) )
		for strandIndex in range( 0, pm.mel.OxGetStrandCount( editGuidesShape ) ):
			pointCount = pm.mel.OxGetStrandPointCount( editGuidesShape, strandIndex )
			editGuidesCommandArguments += ' ' + str( strandIndex )
			editGuidesCommandArguments += ' ' + str( pointCount )
			for pointIndex in ( 0, pointCount ):
				editGuidesCommandArguments += ' 4 0 0'

		# Guides shape needs to be selected for the command to actually function
		# In some tests it was silently failing before
		pm.select( editGuidesShape )
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + ' ' + editGuidesCommandArguments + ';' )

	def test_EditGuidesCommand( self ):
		plane = pm.polyPlane( sx = 1, sy = 1 )
		pm.select( plane )
		meshShape = plane[0]

		# Add guides from mesh with vertex distribution
		editGuidesShape = TestUtilities.AddEditGuidesToMesh( meshShape, rootGenerationMethod = 4 )

		# Add guide shape to it
		self.assertEqual( 1, len( pm.ls( type = TestUtilities.HairShapeName ) ) )
		self.assertEqual( 4, len( meshShape.vtx ) )
		self.assertEqual( len( meshShape.vtx ), pm.mel.OxGetStrandCount(editGuidesShape) )

		# Record initial vertex positions
		tipPositions = []
		for i in range( 0, pm.mel.OxGetStrandCount( editGuidesShape ) ):
			tipPositions.append( pm.mel.OxGetStrandPoint( editGuidesShape, i, 1 ) )

		# Move vertices using the edit guides command
		self.ExecuteEditGuidesOffsetCommand( editGuidesShape )

		# Vertex positions after editing should all be offset by 4 units
		for i in range( 0, pm.mel.OxGetStrandCount( editGuidesShape ) ):
			beforeAfterDelta = dt.Vector( pm.mel.OxGetStrandPoint( editGuidesShape, i, 1 ) ).distanceTo( tipPositions[i] )
			self.assertLess( abs( beforeAfterDelta - 4 ), 0.0001, str( beforeAfterDelta ) )

		# Undo the change
		pm.undo()

		# Guide tips should be back to original positons
		for i in range( 0, pm.mel.OxGetStrandCount( editGuidesShape ) ):
			beforeAfterDelta = dt.Vector( pm.mel.OxGetStrandPoint( editGuidesShape, i, 1 ) ).distanceTo( tipPositions[i] )
			self.assertLess( beforeAfterDelta, 0.0001 )

		# Redo the change and test for offset again
		pm.redo()
		for i in range( 0, pm.mel.OxGetStrandCount( editGuidesShape ) ):
			beforeAfterDelta = dt.Vector( pm.mel.OxGetStrandPoint( editGuidesShape, i, 1 ) ).distanceTo( tipPositions[i] )
			self.assertLess( abs( beforeAfterDelta - 4 ), 0.0001, str( beforeAfterDelta ) )

