	@unittest.skipIf( MayaTest.InBatchMode, "Requires GUI" )
	def test_CombBrush( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( guideLength = 5.0 )
		self.SetupBrushTest( editGuidesShape )

		viewportName = 'modelPanel4'
		viewportWidth = pm.control(viewportName, query=True, width=True)
		viewportHeight = pm.control(viewportName, query=True, height=True)

		# Set move brush
		try:
			pm.mel.eval( "OxCombBrushTool oxCombBrushTool1" )
		except:
			pass
		pm.setToolTo( "oxCombBrushTool1" )
		pm.mel.eval( "OxCombBrushTool -e -s " + str( viewportHeight / 2 ) + " oxCombBrushTool1" )

		# Get the positions of the four tip vertices before moving them with a brush
		strandTipsBeforeBrushing = [pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 1 ), pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 1, 1 ), pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 2, 1 ), pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 3, 1 )]

		# Begin brushing in the center of the view in upper corner and drag brush horizontally to the right
		pm.mel.OxDragBrush( viewportWidth / 2.0, viewportHeight / 2.0, viewportWidth * ( 2.0 / 3.0 ), viewportHeight / 2.0, 3 )

		strandTipsAfterBrushing = [pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 1 ), pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 1, 1 ), pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 2, 1 ), pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 3, 1 )]

		# Make sure that the strand tips have indeed moved due to brushing
		epsilon = 0.01
		for i in range(0, 3):
			distanceDelta = dt.Vector( strandTipsBeforeBrushing[i] ).distanceTo( strandTipsAfterBrushing[i] )
			self.assertGreater( distanceDelta, epsilon )

