	def test_ControlPointMoveUndo( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane()
		tipPositionsBeforeMove = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )
		pm.select( editGuidesShape + ".ep[2:3]" )

		tipPositionsAfterMove = []

		with MayaTest.UndoChunk():
			# Move the two selected guide control points
			pm.move( 0, 0, 5, relative = True )
			pm.mel.OxEditGuides( cc = True )

			tipPositionsAfterMove = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )

			for i in range( 2, len( tipPositionsBeforeMove ) ):
				self.assertGreaterEqual( dt.Vector( tipPositionsBeforeMove[i] ).distanceTo( tipPositionsAfterMove[i] ), 3,
				'Move: i: %(i)d, before: %(before)s, after: %(after)s' % { 'i': i, 'before': tipPositionsBeforeMove[i], 'after' : tipPositionsAfterMove[i] } )

		pm.undo()

		tipPositionsAfterUndo = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )

		# After undo the guide tips should return to their previous positions
		for i in range( 2, len( tipPositionsBeforeMove ) ):
			self.assertLessEqual( dt.Vector( tipPositionsBeforeMove[i] ).distanceTo( tipPositionsAfterUndo[i] ), 0.0001,
			'Undo: i: %(i)d, before: %(before)s, after: %(after)s' % { 'i': i, 'before': tipPositionsBeforeMove[i], 'after' : tipPositionsAfterUndo[i] } )

		# Repeating the move should put them into same positions as previous move
		# TODO: Selection is cleared after undo since 18011, so we need to select again until this is fixed
		pm.select( editGuidesShape + ".ep[2:3]" )
		pm.move( 0, 0, 5, relative = True )
		pm.mel.OxEditGuides( cc = True )
		tipPositionsAfterSecondMove = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )

		for i in range( 2, len( tipPositionsAfterMove ) ):
			self.assertLessEqual( dt.Vector( tipPositionsAfterMove[i] ).distanceTo( tipPositionsAfterSecondMove[i] ), 0.0001,
			'Repeat: i: %(i)d, before: %(before)s, after: %(after)s' % { 'i': i, 'before': tipPositionsAfterMove[i], 'after' : tipPositionsAfterSecondMove[i] } )

	def test_ChangingGuideCountDoesNotResetGuideShapeChanges( self ):
		plane = pm.polyPlane( sx = 1, sy = 1 )
		pm.select( plane )
		meshShape = plane[0]
		editGuidesShape = TestUtilities.AddEditGuidesToMesh( meshShape, rootGenerationMethod = 4 )

		# Move vertices using the edit guides command
		self.ExecuteEditGuidesOffsetCommand( editGuidesShape )

		# Record vertex positions for later comparison
		tipPositions = []
		for i in range( 0, pm.mel.OxGetStrandCount( editGuidesShape ) ):
			tipPositions.append( pm.mel.OxGetStrandPoint( editGuidesShape, i, 1 ) )

		# Change the underlying root distribution method to something else, evaluate, and then change it back to per-vertex
		guidesFromMeshNode = pm.ls( type = TestUtilities.GuidesFromMeshNodeName )[0]
		guidesFromMeshNode.distribution.set( 0 )
		pm.mel.OxGetStrandCount( editGuidesShape )
		guidesFromMeshNode.distribution.set( 4 )

		# Shape changes should still remain
		TestUtilities.CheckTipPositionsEqual( self, editGuidesShape, tipPositions )

	def test_SelectStrands( self ):
		plane = pm.polyPlane( sx = 1, sy = 1 )
		pm.select( plane )
		meshShape = plane[0]
		editGuidesShape = TestUtilities.AddEditGuidesToMesh( meshShape, rootGenerationMethod = 4 )

		pm.select( editGuidesShape + '.f[1:2]' )
		selectedStrands = pm.mel.OxGetSelectedStrands( editGuidesShape )
		self.assertEqual( selectedStrands, [0, 1, 1, 0] )

		pm.select( clear = True ) #deselects shape, but preserves last selected strands
		selectedStrands = pm.mel.OxGetSelectedStrands( editGuidesShape )
		self.assertEqual( selectedStrands, [0, 1, 1, 0] ) #check last selected strands

		# check selected strands can be filtered with Polygon Face selection mask
		pm.select( editGuidesShape + '.f[1:2]' )
		selectionList = cmds.ls( selection=True )
		filteredList = cmds.filterExpand( selectionList, expand=False, selectionMask=34 )
		self.assertEqual( selectionList, filteredList )

		# check selected strand EPs can be filtered with Edit Points selection mask
		pm.select( editGuidesShape + '.ep[1:2]' )
		selectionList = cmds.ls( selection=True )
		filteredList = cmds.filterExpand( selectionList, expand=False, selectionMask=30 )
		self.assertEqual( selectionList, filteredList )

