	def test_PushAwayFromMesh( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewSphere( radius = 5, pointsPerStrandCount = 10, segmentCount = 10 )
		pm.select( editGuidesShape + ".ep[0:91]" )
		pm.move( 0, 0, 20, relative = True )
		pm.mel.OxEditGuides( cc = True )
		tipPositionsBeforePush = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )
		tipPositionsAfterPush = []

		# Push away from mesh
		with MayaTest.UndoChunk():
			pm.mel.OxPushAwayFromMesh( editGuidesShape, 0.1 )
			tipPositionsAfterPush = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )
			TestUtilities.CheckPointsNotAllNearEqual( self, tipPositionsBeforePush, tipPositionsAfterPush )

		pm.undo()
		tipPositionsAfterUndo = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )
		TestUtilities.CheckPointsAllNearEqual( self, tipPositionsBeforePush, tipPositionsAfterUndo )

	def test_PushAwayFromMeshPreservesStrandLength( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewSphere( radius = 5, pointsPerStrandCount = 50, segmentCount = 10 )
		strandLengthsBeforePush = TestUtilities.GetStrandLengths( editGuidesShape )

		editGuidesShape.autoPushAwayFromSurface.set( True )
		pm.select( editGuidesShape + ".ep[0:91]" )
		pm.move( 0, 0, 20, relative = True )
		pm.mel.OxEditGuides( cc = True )

		strandLengthsAfterPush = TestUtilities.GetStrandLengths( editGuidesShape )
		for lengthBefore, lengthAfter in zip( strandLengthsBeforePush, strandLengthsAfterPush ):
			self.assertAlmostEqual( lengthBefore, lengthAfter, delta = 0.0001 )


	def test_ChangesArePreservedWhenToggledInStack( self ):
		# Add edit guides to a plane and move the tips
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane()

		pm.mel.OxShowHairStackDialog( "-show" )
		pm.mel.OxUpdateHairStackDialog()
		guidesShape = pm.mel.OxGetHairStackDialogNodes()[0]

		pm.select( editGuidesShape + ".ep[0:3]" )
		pm.move( 0, 0, 20, relative = True )
		pm.mel.OxEditGuides( cc = True )
		tipPositionsAfterMove = TestUtilities.GetTipPositions( guidesShape, useObjectCoordinates = True )

		# Toggle the on state of the edit guides operator in the hair stack, the result should be changed
		pm.mel.OxEnableOperator( editGuidesShape, False )
		tipPositionsAfterDisable = TestUtilities.GetTipPositions( guidesShape, useObjectCoordinates = True )
		TestUtilities.CheckPointsNotAllNearEqual( self, tipPositionsAfterMove, tipPositionsAfterDisable )

		# Toggle the edit guides operator back on, it should return the guides modification
		pm.mel.OxEnableOperator( editGuidesShape, True )
		tipPositionsAfterEnable = TestUtilities.GetTipPositions( guidesShape, useObjectCoordinates = True )
		TestUtilities.CheckPointsAllNearEqual( self, tipPositionsAfterMove, tipPositionsAfterEnable )

	def test_PlantRoot( self ):
		# Create an edit guides on top of guides without any data
		editGuidesShape = TestUtilities.AddEditGuidesToNewSphere( radius = 5, guideCount = 1, rootGenerationMethod = 2 )

		self.assertEqual( 1, pm.mel.OxGetStrandCount( editGuidesShape ) )

		# select a strand, so we can copy points from it
		pm.select( editGuidesShape + ".f[0]", r = True );

		# Plant two roots
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + ' -cg 1 0 0 10 0.648876 0.259276 0.0918481 -cv 10 0 0 0 0 0 1.111111 0 0 2.222222 0 0 3.333333 0 0 4.444445 0 0 5.555555 0 0 6.666667 0 0 7.777778 0 0 8.888889 0 0 10 ;' )
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + ' -cg 1 0 0 10 0 0 -cv 10 0 0 0 0 0 1.111111 0 0 2.222222 0 0 3.333333 0 0 4.444445 0 0 5.555555 0 0 6.666667 0 0 7.777778 0 0 8.888889 0 0 10 ;' )

		# There should now be two roots
		self.assertEqual( 3, pm.mel.OxGetStrandCount( editGuidesShape ) )

		# Only the one previous root should be selected
		selectedStrands = pm.mel.OxGetSelectedStrands( editGuidesShape )
		self.assertEqual( selectedStrands, [1, 0, 0] )

		# Make sure the generated strand IDs are the same on all platforms
		strandIds = pm.mel.OxGetStrandIds( editGuidesShape )
		self.assertEqual( [240000, 1295363467, 1148853900], strandIds )

		tipPositionsBeforeSave = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )

		TestUtilities.SaveAndReloadScene( self, 'test_PlantRoot', False )

		editGuidesShape = pm.ls( type = TestUtilities.HairShapeName )[0]
		tipPositionsAfterLoad = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )

		self.assertGreaterEqual( 0.001, dt.Vector( tipPositionsBeforeSave[0] ).distanceTo( tipPositionsAfterLoad[0] ) )
		self.assertGreaterEqual( 0.001, dt.Vector( tipPositionsBeforeSave[1] ).distanceTo( tipPositionsAfterLoad[1] ) )

	def TestDeletePerRootChannel( self, editGuidesShape ):
		pm.select( editGuidesShape )

		# Initially we just have the selection channel
		self.assertEqual( 1, len( pm.mel.OxGetRootChannels( editGuidesShape ) ) )

		# Add a new channel
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -crc 1 Clustering;" )
		self.assertEqual( 2, len( pm.mel.OxGetRootChannels( editGuidesShape ) ) )

		# Delete the channel
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -drc 2 0 1;" )
		self.assertEqual( 1, len( pm.mel.OxGetRootChannels( editGuidesShape ) ) )

