	def TestPerVertexChannelValuesAreSavedWithScene( self, fileExtension ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane()
		pm.select( editGuidesShape )
		pm.mel.eval( TestUtilities.EditGuidesCommandName + " -cvc 1 Test;" )
		pm.mel.eval( TestUtilities.EditGuidesCommandName + " -vcd 1 0 1 0 2 0.5 0.5;" )

		# Save and reload the scene, the per-vertex value changes we did above should still be there
		fileName = 'temp.' + fileExtension
		filePath = pm.saveAs( fileName )
		pm.openFile( filePath, force = True )

		editGuidesShape = pm.ls( type = TestUtilities.HairShapeName )[0]
		self.assertEqual( ["Test"], pm.mel.OxGetVertexChannels( editGuidesShape ) )
		self.assertSequenceAlmostEqual( [0.5, 0.5, 0, 0, 0, 0, 0, 0], pm.mel.OxGetVertexValuesForChannel( editGuidesShape, 0 ) )

