	def test_DeletingPerVertexChannelAlsoDeletesItsModifiedValues( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane()
		pm.select( editGuidesShape )

		# Add a new per-vertex channel and modify its values
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -cvc 1 Test;" )
		# The channel should have all zero values initially
		self.assertSequenceAlmostEqual( [0, 0, 0, 0, 0, 0, 0, 0], pm.mel.OxGetVertexValuesForChannel( editGuidesShape, 0 ) )
		pm.mel.eval( "OxEditGuides -vcd 1 1 1 0 2 0.2 0.1;" )
