		# delete the created per-vertex channel
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -dvc 1 1" )

		# Create per-vertex channel again and make sure that its values are all zero
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -cvc 1 Test;" )
		self.assertSequenceAlmostEqual( [0, 0, 0, 0, 0, 0, 0, 0], pm.mel.OxGetVertexValuesForChannel( editGuidesShape, 0 ) )

