	def TestMovingRootsDoesNotChangeStrandShape( self, editGuidesShape, moveTestVectors ):
		# Select and move the first root
		pm.select( editGuidesShape + ".f[0]" )
		strand1TangentBeforeMoving = dt.Vector( pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 1 ) ) - dt.Vector( pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 0 ) )

		for moveTestVector in moveTestVectors:
			## The root should have been moved
			pm.move( moveTestVector[0], moveTestVector[1], moveTestVector[2], relative = True )
			pm.mel.OxEditGuides( cc = True )

			strand1TangentAfterMoving = dt.Vector( pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 1 ) ) - dt.Vector( pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 0 ) )

			# The tangent direction of the strand should have not changed
			error = ( strand1TangentBeforeMoving - strand1TangentAfterMoving ).length()
			self.assertAlmostEqual( 0.0, error, places = 2, msg = "moveTestVector: " + str( moveTestVector ) + ", error: " +
						  str( error ) + ", Tangent before move: " + str( strand1TangentBeforeMoving ) + " != Tangent after move: " + str( strand1TangentAfterMoving ) )

