	def test_MoveGuideAfterDeletingOtherGuides( self ):
		# Generate 4 guides with face-center distribution and edit them
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( planeSegmentCount = 2, rootGenerationMethod = 6, guideCount = 10 )

		# Select and delete last two guides
		pm.select( editGuidesShape + ".f[1]" )
		pm.select( editGuidesShape + ".f[2]", add = True )
		pm.select( editGuidesShape + ".f[3]", add = True )
		pm.mel.eval( "OxEditGuides -dg 3 1 2 3;" )

		# Select and try to move the first root
		pm.select( editGuidesShape + ".f[0]" )

		root5PositionBeforeMoving = pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 0 )

		# The root should have been moved
		pm.move( 0, 0, 0.2, relative = True )
		pm.mel.OxEditGuides( cc = True )
		root5PositionAfterMoving1 = pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 0 )
		self.assertAlmostEqual( root5PositionBeforeMoving[2] + 0.2, root5PositionAfterMoving1[2] )

		# Moving the root another 0.2 units along z coordinate should produce incremented z value
		pm.move( 0, 0, -0.3, relative = True )
		pm.mel.OxEditGuides( cc = True )
		root5PositionAfterMoving2 = pm.mel.OxGetStrandPointInObjectCoordinates( editGuidesShape, 0, 0 )
		self.assertAlmostEqual( root5PositionAfterMoving1[2] - 0.3, root5PositionAfterMoving2[2] )

