	def test_CopyGuideShapeOnPlanting( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( pointsPerStrandCount = 2, guideLength = 1, lengthRandomness = 0 )

		# Spread the guides apart using a surface comb node
		guidesFromMeshNode = pm.ls( type = TestUtilities.GuidesFromMeshNodeName )[0]
		surfaceCombNode = pm.PyNode( pm.mel.OxAddStrandOperator( guidesFromMeshNode, TestUtilities.SurfaceCombNodeName ) )
		surfaceCombNode.algorithm.set( 0 )

		# Select one of the guides and plant a new guide
		pm.select( editGuidesShape + ".ep[2]" );
		pm.mel.eval( "OxPlantGuideDirectly " + editGuidesShape + " 0 0.08669 0.2385;" )

		# The vector formed by planted guide in object space should be the same as its source guide
		vertices = TestUtilities.GetVerticesInObjectCoordinates( editGuidesShape )

		sourceGuideVector = dt.Vector( vertices[2 * 2 + 1] ) - dt.Vector( vertices[2 * 2] )
		newGuideVector = dt.Vector( vertices[4 * 2 + 1] ) - dt.Vector( vertices[4 * 2] )
		self.assertAlmostEqual( sourceGuideVector[0], newGuideVector[0], places = 4 )
		self.assertAlmostEqual( sourceGuideVector[1], newGuideVector[1], places = 4 )
		self.assertAlmostEqual( sourceGuideVector[2], newGuideVector[2], places = 4 )

	def test_CopiedGuideShapePreservesRootData( self ):
		# Create some guides, add a root channel, and set some values to it
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( pointsPerStrandCount = 2, guideLength = 1, lengthRandomness = 0 )
		pm.select( editGuidesShape )
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -crc 1 Groups;" )
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -rcd 2 4 0 0 0 0 1 2 1 2;" )

		strandIds = pm.mel.OxGetStrandIds( editGuidesShape )

		expectedValuesByStrandIds = TestUtilities.MakeDictionary( [0, 1, 2, 3], [1, 2, 1, 2] )
		actualValuesByStrandId = TestUtilities.MakeDictionary( strandIds, pm.mel.OxGetRootValuesForChannel( editGuidesShape, 1 ) )

		TestUtilities.AssertEqualByKeys( self, expectedValuesByStrandIds, actualValuesByStrandId )

		# Select the last guide and plant a new guide, which should copy its settings
		pm.select( editGuidesShape + ".ep[3]" );
		pm.mel.eval( "OxPlantGuideDirectly " + editGuidesShape + " 0 0.08669 0.2385;" )

		# Check that the newly planted guide copied the root channel data from last root
		self.assertEqual( actualValuesByStrandId[strandIds[3]], pm.mel.OxGetRootValuesForChannel( editGuidesShape, 1 )[4] )

	def test_CopiedGuidePreservesStrandGroup( self ):
		# Create some guides, add a root channel, and set some values to it
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( pointsPerStrandCount = 2, guideLength = 1, lengthRandomness = 0 )
		pm.select( editGuidesShape )

		# Assign group 5 to last guide
		editGuidesShape.useStrandGroups.set( True )
		pm.select( editGuidesShape + ".ep[3]" )
		pm.mel.OxAssignStrandGroup( editGuidesShape, "5" )

		# Select the last guide and plant a new guide, which should copy its settings
		pm.select( editGuidesShape + ".ep[3]" );
		pm.mel.eval( "OxPlantGuideDirectly " + editGuidesShape + " 0 0.08669 0.2385;" )

		# The group of the last guide should be 5
		pm.mel.OxSelectStrandGroup( editGuidesShape, 5 )
		self.assertEqual( [0, 0, 0, 1, 1], pm.mel.OxGetSelectedStrands( editGuidesShape ) )

	# There should be no problems planting two guides in the same spot and later editing them
	def test_PlantTwoGuidesInSameSpot( self ):
		# Plant two guides in the exact same location
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( pointsPerStrandCount = 2, guideLength = 1, lengthRandomness = 0 )
		pm.select( editGuidesShape )
		plantCommand = "OxPlantGuideDirectly " + editGuidesShape + " 0 0.08669 0.2385;"
		for i in range( 0, 2 ):
			pm.mel.eval( plantCommand )
		pm.mel.OxEditGuides( cc = True )

		# Select and change tip position of just the last guide
		pm.select( editGuidesShape + ".ep[4]" );
		pm.move( 0.5, 0, 0.5, relative = True )
		pm.mel.OxEditGuides( cc = True )
		guide6tipPosition = pm.mel.OxGetStrandPoint( editGuidesShape, 4, 1 )

		# Change first planeted guide's tip position
		pm.select( editGuidesShape + ".ep[5]" );
		pm.move( -0.5, 0, -0.5, relative = True )
		pm.mel.OxEditGuides( cc = True )

		# The position of last guide's tip should remain as it was
		self.assertEqual( guide6tipPosition, pm.mel.OxGetStrandPoint( editGuidesShape, 4, 1 ) )

	def test_PlantNewHair( self ):
		# Create some guides, add a root channel, and set some values to it
		hairShape = TestUtilities.AddHairToNewPlane()
		editGuidesShape = pm.PyNode( pm.mel.OxAddStrandOperator( hairShape, TestUtilities.EditGuidesShapeName ) )
		pm.select( editGuidesShape )

		boundingBoxBeforePlanting = TestUtilities.GetBoundingBox( TestUtilities.GetVerticesInObjectCoordinates( hairShape ) )

		# Select the first guide and plant a new guide, which should copy its settings
		pm.select( editGuidesShape + ".ep[0]" );
		pm.mel.eval( "OxPlantGuideDirectly " + editGuidesShape + " 0 0.08669 0.2385;" )

		# Check that the newly planted hair is correctly positioned
		boundingBoxAfterPlanting = TestUtilities.GetBoundingBox( TestUtilities.GetVerticesInObjectCoordinates( hairShape ) )

		TestUtilities.CheckPointsAllNearEqual( self, boundingBoxBeforePlanting, boundingBoxAfterPlanting )

		# Repeat one more time
		pm.mel.eval( "OxPlantGuideDirectly " + editGuidesShape + " 0 0.08669 0.2385;" )

		# Check that the newly planted hair is correctly positioned
		boundingBoxAfterPlantingTwice = TestUtilities.GetBoundingBox( TestUtilities.GetVerticesInObjectCoordinates( hairShape ) )

		TestUtilities.CheckPointsAllNearEqual( self, boundingBoxBeforePlanting, boundingBoxAfterPlantingTwice )

