	def test_ReloadMayaAsciiWithMovedRootAndShapeChanges( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( pointsPerStrandCount = 2, guideLength = 1, lengthRandomness = 0 )
		pm.select( editGuidesShape )

		# Select and move all roots
		pm.select( editGuidesShape + ".f[0:3]" )
		pm.move( 0.5, 0, 0.5, relative = True )
		pm.mel.OxEditGuides( cc = True )

		# Move guide's tip as well
		pm.select( editGuidesShape + ".ep[0:2]" );
		pm.move( 0.5, 0, 0.5, relative = True )
		pm.mel.OxEditGuides( cc = True )

		verticesBeforeSave = TestUtilities.GetVerticesInObjectCoordinates( editGuidesShape )

		# Save and reload the scene into an Ascii file
		fileName = 'temp.ma'
		filePath = pm.saveAs( fileName )
		pm.openFile( filePath, force = True )

		editGuidesShape = pm.ls( type = TestUtilities.EditGuidesShapeName )[0]
		verticesAfterLoad = TestUtilities.GetVerticesInObjectCoordinates( editGuidesShape )

		TestUtilities.CheckPointsAllNearEqual( self, verticesBeforeSave, verticesAfterLoad )

