	# When using multi-threaded strand generation the roots can be generated in a different order each time. This test makes sure that strand groups
	# assigned to these roots are always consistent with the strand ids.
	def test_MultiThreadedStrandGenerationAndStrandGroupAssignment( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane( pointsPerStrandCount = 2, rootGenerationMethod = 1, guideCount = 30 )

		# Create and assign some strand groups
		pm.mel.eval( TestUtilities.EditGuidesCommandName  + " -crc 1 Groups;" )

		strandCount = pm.mel.OxGetStrandCount( editGuidesShape )
		initialStrandIds = pm.mel.OxGetStrandIds( editGuidesShape )

		# Construct and execute a command which will set unique root indices for each strand
		editRootDataCommand = TestUtilities.EditGuidesCommandName + " -sd " + str( strandCount );
		for i in range( 0, strandCount ):
			# Changing strand id at i, for 1 channel, second one
			editRootDataCommand += " " + str( initialStrandIds[i] ) + " 1 1 " + str( i )

		editRootDataCommand += ";"
		pm.mel.eval( editRootDataCommand )

		#print( editRootDataCommand )
		initialStrandGroups = pm.mel.OxGetRootValuesForChannel( editGuidesShape, 1 )

		# Save and reload the scene
		fileName = 'temp.ma'
		filePath = pm.saveAs( fileName )
		pm.openFile( filePath, force = True )

		editGuidesShape = pm.ls( type = TestUtilities.EditGuidesShapeName )[0]
		reloadedStrandGroups = pm.mel.OxGetRootValuesForChannel( editGuidesShape, 1 )
		reloadedStrandIds = pm.mel.OxGetStrandIds( editGuidesShape )

		errorMessage = "Initial ids: " + str( initialStrandIds ) + "\nInitial groups: " + str( initialStrandGroups ) + "\nReloaded ids: " + str( reloadedStrandIds ) + "\nReloadedgroups:" + str( reloadedStrandGroups )
		#print( errorMessage )

		# Make sure that the groups still match the strands
		for strandIndex in range( 0, len( initialStrandGroups ) ):
			initialStrandGroup = initialStrandGroups[strandIndex]
			initialStrandId = initialStrandIds[strandIndex]
			for reloadedStrandIndex in range( 0, len( reloadedStrandGroups ) ):
				reloadedStrandGroup = reloadedStrandGroups[reloadedStrandIndex]
				reloadedStrandId = reloadedStrandIds[reloadedStrandIndex]

				if initialStrandId == reloadedStrandId:
					# For the strand with the same id the strand groups must also match
					self.assertEqual( initialStrandGroup, reloadedStrandGroup, errorMessage )
					break

		# Repeat test saving as a binary file
		fileName = 'temp.mb'
		filePath = pm.saveAs( fileName )
		pm.openFile( filePath, force = True )

		editGuidesShape = pm.ls( type = TestUtilities.EditGuidesShapeName )[0]
		reloadedStrandGroups = pm.mel.OxGetRootValuesForChannel( editGuidesShape, 1 )
		reloadedStrandIds = pm.mel.OxGetStrandIds( editGuidesShape )

		# Make sure that the groups still match the strands
		for strandIndex in range( 0, len( initialStrandGroups ) ):
			initialStrandGroup = initialStrandGroups[strandIndex]
			initialStrandId = initialStrandIds[strandIndex]
			for reloadedStrandIndex in range( 0, len( reloadedStrandGroups ) ):
				reloadedStrandGroup = reloadedStrandGroups[reloadedStrandIndex]
				reloadedStrandId = reloadedStrandIds[reloadedStrandIndex]

				if initialStrandId == reloadedStrandId:
					# For the strand with the same id the strand groups must also match
					self.assertEqual( initialStrandGroup, reloadedStrandGroup )
					break

