	def test_ControlPointSoftSelection( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane()
		tipPositionsBeforeMove = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )
		pm.setAttr( editGuidesShape + ".useSoftSelection", True )
		pm.select( editGuidesShape + ".ep[3]" )

		# Move the selected guide control point
		pm.move( 0, 0, 5, relative = True )
		pm.mel.OxEditGuides( cc = True )

		tipPositionsAfterMove = TestUtilities.GetTipPositions( editGuidesShape, useObjectCoordinates = True )

		# All tips should have moved due to soft selection
		for i in range( len( tipPositionsBeforeMove ) ):
			self.assertGreaterEqual( dt.Vector( tipPositionsBeforeMove[i] ).distanceTo( tipPositionsAfterMove[i] ), 3,
			'Move: i: %(i)d, before: %(before)s, after: %(after)s' % { 'i': i, 'before': tipPositionsBeforeMove[i], 'after' : tipPositionsAfterMove[i] } )

	@staticmethod
	def MoveAllControlPoints( editGuidesShape, vector ):
		pm.select( editGuidesShape + ".ep[0:" + str( pm.mel.OxGetStrandCount( editGuidesShape ) - 1 ) + "]" )
		pm.move( vector[0], vector[1], vector[2], relative = True )
		pm.mel.OxEditGuides( cc = True )

	# Tests that planting guides with precise surface coordinates and shape edits (which hash said surface coordinates) will load the scene correctly when saved as ascii
	def test_ReloadAsciiSceneWithPlantedGuidesAndShapeChanges( self ):
		editGuidesShape = TestUtilities.AddEditGuidesToNewPlane()

		# Plant a new guide. Note that we are using precise coordinates which can be rounded when being hashed to generate the guide id. So they need to be stored precisely in ASCII file.
		TestUtilities.CreateStrand( 0, [0.0213666093, 0.774024785], 10, 5 )
		self.MoveAllControlPoints( editGuidesShape, [5, 0, 10] )

		verticesBeforeReload = pm.mel.OxGetVertices( editGuidesShape, os = True )

		# Save and reload the scene
		filePath = pm.saveAs( self.addTempFile( 'test_ReloadAsciiSceneWithPlantedGuidesAndShapeChanges.ma' ) )
		pm.openFile( filePath, force = True )

		editGuidesShape = pm.ls( type = TestUtilities.EditGuidesShapeName )[0]
		verticesAfterReload = pm.mel.OxGetVertices( editGuidesShape, os = True )

		TestUtilities.CheckPointsAllNearEqual( self, verticesBeforeReload, verticesAfterReload )

